import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, useParams } from "react-router-dom";

const projects = [
  {
    id: "semantic-search",
    title: "AI-Powered Semantic Search & Product Ranking System",
    date: "April 16, 2025",
    description:
      "In a world of millions of product listings, relevance is everything... semantic search comes into play. I developed a system that goes beyond keywords and retrieves results based on meaning—exactly how humans think.",
    tags: ["AI", "Search", "NLP"],
    image: "https://via.placeholder.com/600x300?text=Semantic+Search"
  },
  {
    id: "rag-gpt",
    title: "RAG-Based Emerald GPT – AI Assistant with Pinecone",
    date: "April 16, 2025",
    description:
      "Built a RAG-based AI assistant using GPT and Pinecone to perform semantic searches over vector databases with enhanced relevance and response quality.",
    tags: ["GPT", "Pinecone", "RAG"],
    image: "https://via.placeholder.com/600x300?text=RAG+GPT"
  }
];

function Header() {
  return (
    <header className="bg-white shadow-md py-4 px-6 sticky top-0 z-50">
      <div className="max-w-6xl mx-auto flex items-center justify-between">
        <h1 className="text-2xl font-bold text-gray-800">🧠 AI Project Blog</h1>
        <Link to="/" className="text-blue-600 hover:underline text-sm">Home</Link>
      </div>
    </header>
  );
}

function Footer() {
  return (
    <footer className="text-center text-gray-500 text-sm mt-16 py-6 border-t">
      © 2025 Deepika's AI Blog. All rights reserved.
    </footer>
  );
}

function Home() {
  return (
    <div className="bg-gray-50 min-h-screen">
      <Header />
      <main className="p-6 max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold mb-6">Latest AI Projects</h2>
        <div className="grid md:grid-cols-2 gap-8">
          {projects.map((project) => (
            <Link to={`/project/${project.id}`} key={project.id} className="bg-white rounded-2xl shadow hover:shadow-lg transition-all border border-gray-200 overflow-hidden">
              <img src={project.image} alt={project.title} className="w-full h-48 object-cover" />
              <div className="p-5">
                <p className="text-xs text-gray-500 mb-1">{project.date}</p>
                <h3 className="text-xl font-semibold text-gray-800 mb-2">{project.title}</h3>
                <div className="flex flex-wrap gap-2">
                  {project.tags.map((tag) => (
                    <span key={tag} className="text-xs bg-blue-100 text-blue-700 px-2 py-1 rounded-full">{tag}</span>
                  ))}
                </div>
              </div>
            </Link>
          ))}
        </div>
      </main>
      <Footer />
    </div>
  );
}

function ProjectPage() {
  const { id } = useParams();
  const project = projects.find((p) => p.id === id);

  if (!project) return <p className="p-4">Project not found</p>;

  return (
    <div className="bg-gray-50 min-h-screen">
      <Header />
      <main className="p-6 max-w-4xl mx-auto">
        <img src={project.image} alt={project.title} className="w-full h-64 object-cover rounded-xl mb-6" />
        <h1 className="text-4xl font-bold mb-4 text-gray-800">{project.title}</h1>
        <p className="text-gray-500 mb-4">{project.date}</p>
        <p className="text-lg leading-relaxed mb-6 text-gray-700">{project.description}</p>
        <div className="flex flex-wrap gap-2">
          {project.tags.map((tag) => (
            <span key={tag} className="text-sm bg-blue-100 text-blue-700 px-3 py-1 rounded-full">{tag}</span>
          ))}
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/project/:id" element={<ProjectPage />} />
      </Routes>
    </Router>
  );
}
